(15, 'Who is Tim Malone [Don Lemonâ€™s partner]? Wiki-Bio, kids, net worth.', 'don-lemon-partner-tim-lemon', '<p>Even though Don Lemon doesn&rsquo;t hold back with stirring controversies during his nightly appearances for CNN, his personal life doesn&rsquo;t have any space for them. Don is happily engaged to Tim Malone, a real estate agent who previously worked in the media. The pair first met in 2016 and have been inseparable since then. Even though they got engaged in 2019, the pair seem like they have been together forever. Unlike most celebrity couples, both Don and Tim are quite open about their relationship. Both have been known to make public appearances and share details on their relationship on social media. So, for this article, we will take a closer look at the wiki-bio of Tim Malone.</p>\r\n\r\n<h2>Early Life:</h2>\r\n\r\n<p>Tim Malone was born on the 5th of April 1984, in Water Mill, New York, US. Born and raised in Water Mill, not much is known about Malone&rsquo;s early life and the man has not provided many details to go on. On the education side of things, Malone attended the nearby Southampton High School and graduated in 2002. He continued with his education and graduated with a Bachelor of Science degree in history and journalism from Boston College.</p>\r\n\r\n<p><img alt=\"\" src=\"https://i0.wp.com/thecelebsinfo.com/wp-content/uploads/2021/12/Tim-Malone.jpg?resize=595%2C526&amp;ssl=1\" style=\"height:526px; width:595px\" /></p>\r\n\r\n<p>Don Lemon partner and a real estate agent Tim Malone</p>\r\n\r\n<h2>Life in media:</h2>\r\n\r\n<p>After graduating from Boston College in 2006. Malone moved to New York and started working as a production assistant on the Today show. He stayed on the Today Show for over a year and later moved to NBC Universal. Following his move to Universal, Malone was assigned to the sales team of their USA and SyFy networks. He was later moved to the sales team of the Sports and Olympics division. Malone left Universal in 2013 and took up a position at Billboard as Director of Brand Partnerships. He was later promoted to Executive Director of Brand Partnerships and spent a total of three years in the role before moving on as the Executive Director of Jukin Media in 2017.</p>\r\n\r\n<h2>Life in real estate:</h2>\r\n\r\n<p>After working in Jukin Media for a year, Malone decided to change his career path and started working as a real estate agent. In 2018, he joined one of New York&rsquo;s premium real estate companies, Corcoran Group. He switched to real estate company Douglas Elliman in 2020 and currently works there.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Meeting Don Lemon:</h2>\r\n\r\n<p>Malone and Lemon first met in the summer of 2016 in New York. Even though several reports suggest that Malone first met Lemon at a bar, Melon has been&nbsp;<a href=\"https://www.oprahmag.com/entertainment/a28510867/don-lemon-engaged-partner-tim-malone/\" target=\"_blank\">clear</a>&nbsp;about their accuracy.</p>\r\n\r\n<blockquote>\r\n<p>&ldquo;Clarification. We did not meet at the bar. He was with me at the bar. We met in New York.&rdquo;</p>\r\n</blockquote>\r\n\r\n<h2>Going public and getting engaged:</h2>\r\n\r\n<p>The pair first revealed their relationship on an Instagram post. They made things public in April of 2017, and later that year were seen hand in hand at the 28th annual GLAAD Media Awards. A year later, in New Year&rsquo;s of 2018, the pair could be spotted kissing on live television. Since going public in 2017, the pair have been posting regular photos of each other on Instagram. The pair is keen to tie the knot and when asked about the plans, Lemon seems to be just enjoying the moment.</p>\r\n\r\n<blockquote>\r\n<p>&ldquo;I&rsquo;m just trying to enjoy this moment of bliss. And then, whenever we get married, we get married. The advice I get from most people is: Don&rsquo;t become obsessed with the ceremony or wedding planning &mdash; just enjoy it.&rdquo;</p>\r\n</blockquote>\r\n\r\n<h2>Tim Malone Children:</h2>\r\n\r\n<p>Tim Malone and his partner Don Lemon have no children of their own. The pair neither has adopted nor tried to extend the family through surrogacy. For now, Tim is content with the family and shows his parenting side by adopting three lovely dogs, Barkley, Gus, and Boomer.</p>\r\n\r\n<h2>Net Worth, How rich is Tim Malone?</h2>\r\n\r\n<p>Tim Malone may have left behind the media days he certainly is reaping the benefits of the experience. Tim is established as a real estate broker and his past works in advertisement give him the upper hand as a real estate marketer. Tim works in both luxury resales and new developments. As for his earning part and assets, Tim has mostly kept under the wraps. Tim does share the house with his partner Don Lemon as they divide their time between Manhattan and Sag Harbor. His better half Don Lemon has reported net worth of $12 Million USD.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'featured_photo0a8733ba09300ad15ade11d1ea69da0b.jpg', '1970-01-01', 'Sunt nisi et eum la', 'Minus molestiae ulla', '2022-08-22 15:40:00', '2022-08-22 16:05:27', NULL, 10),
