(23, 'Her Majesty Queen Elizabeth II Passes Away Peacefully at 96 in Balmoral!', 'her-majesty-queen-elizabeth-ii-passes-away-peacefully-at-96-in-balmoral', '<ul>\r\n	<li><strong><em>Queen Elizabeth II died at her Balmoral estate on Thursday afternoon.</em></strong></li>\r\n	<li><strong><em>The 96-year-old monarch became the longest reigning monarch in British history.</em></strong></li>\r\n	<li><strong><em>Now, her eldest son, Prince Charles has become His Majesty, King Charles III.</em></strong></li>\r\n</ul>\r\n\r\n<hr />\r\n<h2>Find out how the death of Queen Elizabeth II will change the future of the British Monarchy</h2>\r\n\r\n<p>Our deepest condolences to the British Family on the passing of her Majesty&nbsp;<strong>Queen Elizabeth II</strong>.</p>\r\n\r\n<p>The longest reigning monarch in British history passed away at the age of 96 at her favorite Balmoral Castle surrounded by her family.</p>\r\n\r\n<p>Buckingham Palace released a statement confirming the sad news. It read:</p>\r\n\r\n<blockquote>\r\n<p><em>&ldquo;The Queen died peacefully at Balmoral this afternoon. The King and the Queen Consort will remain at Balmoral this evening and will return to London tomorrow,&rdquo;</em></p>\r\n</blockquote>\r\n\r\n<p>After her death,&nbsp;<a href=\"https://marriedbiography.com/prince-charles-biography/\">Prince Charles</a>&nbsp;has now become the King of the United Kingdom and 14 Commonwealth realms.</p>\r\n\r\n<p><img alt=\"Queen\" src=\"https://marriedbiography.com/wp-content/uploads/2022/09/Queen-1.jpg\" style=\"height:500px; width:600px\" /></p>\r\n\r\n<p>Her Majesty&rsquo;s last picture shows her smiling and in good health. source: BBC</p>\r\n\r\n<p>In his own statement, the King said:</p>\r\n\r\n<blockquote>\r\n<p><em>&ldquo;The death of my beloved Mother, Her Majesty The Queen, is a moment of the greatest sadness for me and all members of my family.</em></p>\r\n\r\n<p><em>&ldquo;We mourn profoundly the passing of a cherished Sovereign and a much-loved Mother.</em></p>\r\n\r\n<p><em>&ldquo;I know her loss will be deeply felt throughout the country, the Realms and the Commonwealth, and by countless people around the world.</em></p>\r\n\r\n<p><em>&ldquo;During this period of mourning and change, my family and I will be comforted and sustained by our knowledge of the respect and deep affection in which The Queen was so widely held.&rdquo;</em></p>\r\n</blockquote>\r\n\r\n<p><img alt=\"Queen\" src=\"https://marriedbiography.com/wp-content/uploads/2022/09/Queen-3.jpg\" style=\"height:600px; width:600px\" /></p>\r\n\r\n<p>Prince Charles is now the King of England. source: BBC</p>\r\n\r\n<p>It is believed that the Queen will be given a full state funeral, a traditional way to commemorate the death of a monarch.</p>\r\n\r\n<p>Now, The&nbsp;<a href=\"https://marriedbiography.com/prince-william-biography/\">Duke</a>&nbsp;and&nbsp;<a href=\"https://marriedbiography.com/kate-middleton-biography/\">Duchess of Cambridge</a>&nbsp;will take over the titles of Prince and Princess of Wales. It was previously given to Prince Charles and Princess Diana by the Queen.</p>\r\n\r\n<p>Also, Read&nbsp;<a href=\"https://marriedbiography.com/queen-elizabeth-iis-jewelry-collection-worth/\">Queen Elizabeth II&rsquo;s Jewelry Collection Worth!</a></p>\r\n\r\n<h2>A look back into the life of the Queen</h2>\r\n\r\n<p>Princess Elizabeth Alexandra Mary was born in London on 26 April 1926 to then&nbsp;<strong>Prince George</strong>&nbsp;and&nbsp;<strong>Princess Elizabeth</strong>.</p>\r\n\r\n<p>At that time, nobody expected her to be the Queen because her uncle&nbsp;<strong>Prince Edward</strong>&nbsp;was the first in line to the throne followed by her father.</p>\r\n\r\n<p>She married&nbsp;<strong>Prince Philips</strong>&nbsp;with whom she shares 4 children, Prince Charles,&nbsp;<a href=\"https://marriedbiography.com/anne-princess-royal-biography/\">Princess Anne</a>,&nbsp;<a href=\"https://marriedbiography.com/prince-andrew-biography/\">Prince Andrew</a>, and&nbsp;<strong>Prince Edward</strong>.</p>\r\n\r\n<p>Her father became the king after Edward abdicated the throne and after the King&rsquo;s death in 1952, Princess Elizabeth became Queen at the age of 25.</p>\r\n\r\n<p><img alt=\"Queen\" src=\"https://marriedbiography.com/wp-content/uploads/2022/09/Queen-2.jpg\" style=\"height:600px; width:600px\" /></p>\r\n\r\n<p>Princess Elizabeth was only 25 when she became Queen. source: BBC</p>\r\n\r\n<p>16 months later, she was coronated at Westminster Abbey.</p>\r\n\r\n<p>During her historic reign, the Queen dedicated her whole life to serving her nation and the commonwealth.</p>\r\n\r\n<p>Even during her final days, the Queen was working tirelessly at her home in Scotland. Just 3 days prior to her death, she elected UK&rsquo;s new Prime Minister Liz&nbsp; Truss.</p>\r\n\r\n<p>Also, Read&nbsp;<a href=\"https://marriedbiography.com/queen-elizabeth-ii-retiring/\">Is Queen Elizabeth II retiring from the throne anytime soon?</a></p>', 'article_photo_9e80f501d356127422443d49ce4f29a4.jpg', '1970-01-01', 'sdfadsf', 'dsfasdf', '2022-09-12 08:40:03', '2022-09-12 08:40:03', NULL, 1),
