(9, 'Who is Lance Lim?', '<p><strong>Lance Lim</strong>&nbsp;is an American actor who is best known for playing Zack in the musical comedy TV series School of Rock on Nickelodeon, which also stars&nbsp;<a href=\"http://127.0.0.1:8000/biography/eum-hic-incididunt-s#\">Breanna Yde</a>,&nbsp;<a href=\"http://127.0.0.1:8000/biography/eum-hic-incididunt-s#\">Jade Pettyjohn</a>,&nbsp;<a href=\"http://127.0.0.1:8000/biography/eum-hic-incididunt-s#\">Ricardo Hurtado</a>, and&nbsp;<a href=\"http://127.0.0.1:8000/biography/eum-hic-incididunt-s#\">Tony Cavalero</a></p>\n\n<p>He was cast in&nbsp;<em>Independence Day: Resurgence</em>&nbsp;and has made appearances in episodes of&nbsp;<em>Anger Management and Fresh Off the Boat</em>.</p>', 3, 1, '2022-09-08 16:06:42', '2022-11-29 05:31:15', NULL),
(10, 'Lance Lim â€“ Age, Parents, Siblings, Ethnicity, Education', '<p>Lance was&nbsp;<strong>born</strong>&nbsp;on December 16, 2000, in Los Angeles, CA. As of 2022, his&nbsp;<strong>age</strong>&nbsp;is 21 years old. Talking about his&nbsp;<strong>nationality,</strong>&nbsp;he holds an American identity and is of Korean descent.</p>\n\n<p>He has not revealed much information regarding his&nbsp;<strong>educational</strong>&nbsp;background.</p>', 3, 2, '2022-09-08 16:07:03', '2022-09-08 16:07:03', NULL),
(11, 'Lance Lim â€“ Professional Life, Careers', '<p>Lance participated in South Korea&rsquo;s MBC Star Audition before his breakthrough role on Growing Up Fisher. His character on this series, Eli Baker&rsquo;s character Henry Fisher&rsquo;s closest friend was named Runyan.</p>', 3, 3, '2022-09-08 16:07:32', '2022-09-08 16:07:32', NULL);
